import zlib, ast, sys
nouns = ast.literal_eval(zlib.decompress(com))
pronouns = ['i','we','they', 'you']
pronouns_they = ['he','she']

said_words = ["said", "told", "says", "tells"]

def add_apostrophe(input):

	words = input.split()
	for i in range(len(words)-1):
		if words[i].lower() == "hes":
			words[i] = words[i][:-1] + '\'s'
		elif words[i].lower() == "shes":
			words[i] = words[i][:-1] + '\'s'
		elif words[i].lower() == "hed":
			words[i] = words[i][:-1] + '\'d'
		elif words[i].lower() == "shed":
			words[i] = words[i][:-1] + '\'d'
		elif words[i].lower() == "shell":
			words[i] = words[i][:-2] + '\'ll'
		elif words[i].lower() == "im":
			words[i] = words[i][:-1] + '\'m'
		elif words[i].lower() == "id":
			words[i] = words[i][:-1] + '\'d'
		elif words[i].lower() == "weve":
			words[i] = words[i][:-2] + '\'ve'
		elif words[i].lower() == "theyve":
			words[i] = words[i][:-2] + '\'ve'
		elif words[i].lower() == "theyll":
			words[i] = words[i][:-2] + '\'ll'
		elif words[i].lower() == "theyre":
			words[i] = words[i][:-2] + '\'re'
		elif words[i].lower() == "youve":
			words[i] = words[i][:-2] + '\'ve'
		elif words[i].lower() == "youll":
			words[i] = words[i][:-2] + '\'ll'
		elif words[i].lower() == "youre":
			words[i] = words[i][:-2] + '\'re'

		elif words[i].lower() == "isnt":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "cant":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "couldnt":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "shouldnt":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "wouldnt":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "werent":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "arent":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "hadnt":
			words[i] = words[i][:-1] + '\'t'
		elif words[i].lower() == "wont":
			words[i] = words[i][:-1] + '\'t'

		elif words[i].lower() in pronouns+pronouns_they and words[i+1].lower().rstrip('.') in said_words:
			for j in range(i,0,-1):
				if words[j][-1] == ".":
					quote_begin = j+1
					words[quote_begin] = "\'" + words[quote_begin]
					words[i-1] = words[i-1] + "\'"
					break
		elif words[i].lower() in pronouns+pronouns_they and words[i+1][-1] == "," and words[i+1].lower().rstrip(',') in said_words:
			for j in range(i+2,len(words),1):
				if words[j][-1] == ".":
					quote_end = j
					words[quote_begin] = words[quote_begin] + "\'"
					words[i+2] = "\'" + words[i-1] 
					break
		elif words[i][-1] == "s" and len(words[i][:-1]) > 1 and words[i][:-1].lower() in nouns and words[i][:-1].lower() not in pronouns+pronouns_they and (words[i+1].lower().rstrip('.').rstrip('s') in nouns or words[i+1].lower().rstrip('.') in nouns):
			words[i] = str(words[i][:-1]) + '\'s'
		elif words[i][0].isupper() and words[i][-1] == "s" and words[i][:-1].lower() not in nouns and words[i+1].lower() in nouns:
			words[i] = str(words[i][:-1]) + '\'s'
		elif (words[i][-2:] == "ve" or words[i][-2:] == "re" or words[i][-2:] == "ll") and words[i][:-2].lstrip("\"").lower() in pronouns:
			words[i] = str(words[i][:-2]) + '\''+ str(words[i][-2:])



	return ' '.join(words)


